import React from "react";
import Card from "./Card";
import Series from "./Series";

function App(value) {
  return (<>
    <h1>NETFLIX BEST SERIES IN 2022</h1>
     <Card  
      imgsrc={value.imgsrc}
      title={value.title}
      sname={value.sname}
      link={value.link}/> 
    </>
  );
}
export default App;
